import Maximise from './assets/Maximise.png'
import Minimise from './assets/minimise.png'
import Close from './assets/Close.png'
function MinMaxClose() {

    const handleClick = () => {
        console.log("close")
    };
    return (
      <>
        <div className="MinMaxClose">
            <button onClick={handleClick} title="close" accessibilitylabel="Close"><img src={Maximise}></img></button>
            <button onClick={handleClick} title="close" accessibilitylabel="Close"><img src={Maximise}></img></button>
            <button onClick={handleClick} title="close" accessibilitylabel="Close"><img src={Close}></img></button>
        </div>
      </>
    )
  }

  export default MinMaxClose
